import React from 'react';

const Users = () => {
  const data = [
    { title: 'Ali', id: 1 },
    { title: 'Almond', id: 2 },
    { title: 'Fahade', id: 3 },
  ];

  const users = data.map(names => (
    <li key={names.id}>
      {names.title}
    </li>
  ));

  return (
    <ul>{users}</ul>
  );
};

export default Users;
